    return <div className="modal">
        <div className="img" style={{backgroundImage: `url(${currentPhoto.photo})`}}>
        <button onClick={() => {
                    setCurrentPhoto()
                }}>x</button>
        <button>{`<`}</button>
        {/* <img src={currentPhoto.photo}/> */}
        {
            currentPhoto.id !== 4 && <button onClick={onNext}></button>
        }
        </div>
    </div>
}
